import React from "react";
import Box from '@mui/material/Box';

function Signin(){

    return(

        <Box
      sx={{
        width: 850,
        height: 400,
        position:'relative',
        left:400,
        top:250,
        display:'flex',
        flexDirection:'row',
        border:'2px solid red'
         }}>
             <Box sx={{
                    width:'60%',
                    height:'70%',
                    border:'1px solid green',
                    position:'absolute',
                    top:50,


             }}>

             </Box>

             <Box sx={{
                 width:'50%',
                 height:'100%',
                 border:"1px solid blue",

             }}>

             </Box>

        </Box>
    )

}
export default Signin
